create table Booking
(
    BookingID              int auto_increment
        primary key,
    UserID                 int                         null,
    Created                datetime                    null,
    DateBooking            date                        null,
    DateBookingEnd         date                        null,
    CardID                 int                         null,
    BookingStatusID        int                         null,
    Modified               datetime                    null,
    Operator               int                         null,
    PeopleCount            int                         null,
    HotelID                int                         null,
    Notes                  text                        null,
    OperatorNotes          text                        null,
    TotalAmountCurrency    int                         null,
    BaseAmount             decimal(15, 2) default 0.00 null,
    TotalAmountCorrection  decimal(15, 2) default 0.00 null,
    TotalAmount            decimal(15, 2) default 0.00 null,
    UserReview             text                        null,
    UserReviewDate         datetime                    null,
    UserReviewStatusID     int                         null,
    ReviewOperatorApproved int                         null,
    UserLangID             int                         null,
    HotelListID            int                         null,
    HotelRoomsCount        int                         null,
    UnloginedShow          bit            default b'0' null,
    constraint FK_Booking_BookingStatusID
        foreign key (BookingStatusID) references BookingStatus (BookingStatusID),
    constraint FK_Booking_CardID
        foreign key (CardID) references Card (CardID),
    constraint FK_Booking_HotelID
        foreign key (HotelID) references Hotel (HotelID),
    constraint FK_Booking_HotelListID
        foreign key (HotelListID) references HotelList (HotelListID),
    constraint FK_Booking_Operator
        foreign key (Operator) references Users (UserID),
    constraint FK_Booking_ReviewOperatorApproved
        foreign key (ReviewOperatorApproved) references Users (UserID),
    constraint FK_Booking_TotalAmountCurrency
        foreign key (TotalAmountCurrency) references Currency (CurrencyID),
    constraint FK_Booking_UserID
        foreign key (UserID) references Users (UserID),
    constraint FK_Booking_UserLangID
        foreign key (UserLangID) references LangList (LangID),
    constraint FK_Booking_UserReviewStatusID
        foreign key (UserReviewStatusID) references UserReviewStatus (UserReviewStatusID)
)
    collate = utf8_general_ci
    avg_row_length = 146;


